import React, { useState } from "react"

export default function Box(){
    
    const [color,setColor] = useState(false)
    const styles = {backgroundColor: color? "rgb(255,0,0)": "rgb(0,0,255)"
    }
    
    return(
        <div onClick={() => setColor(!color)} style={styles} className="box">

        </div>
    )
}
